(7, '9678813B-B4D3-4DF1-B709-E38458F405AD', 'A8DFAF5E-62B1-4BAE-A17E-448E67FBE5B3', '1637905171.345831', '坪林茶業博物館．銅板價景點，想不到這裡這麼新奇好玩', '台北景點推薦，這一站我們來到了新北坪林茶業博物館，只要銅板價，12歲以下小朋友免門票，cp值還不錯的地方。新北市的坪林茶葉博物館，整修後一直想去看看，這次的來訪才發現坪林茶葉博物館裡面這麼特別，真的很新奇好玩', '2021-10-26', , 0, '新北市', '新莊區');
INSERT INTO `blog` (`id`, `uid`, `user_id`, `timestamp`, `title`, `content`, `date`, `photo`, `like_count`, `city`, `dist`) VALUES
(11, '82535C8A-14EB-4720-A835-98D75A538CA4', 'A8DFAF5E-62B1-4BAE-A17E-448E67FBE5B3', '1637905440.9804049', '卓也小屋．最新書園子喝下午茶~漫步菖蒲小屋花園', '苗栗景點推薦,卓也小屋,來苗栗旅遊,卓也小屋是個很著名,且必去的觀光景點,這次來卓也小屋,發現它和以前不一樣了,除了原本的園區外,現在還打造了一個 超夢幻的牛角村花園,以及菖蒲小屋花園，喜歡拍照的朋友,可以安排再訪，', '2021-11-25', , 0, '苗栗縣', '三義鄉'),
(12, 'C6721064-F346-424A-B5C4-65DCF7CBA0A6', 'A8DFAF5E-62B1-4BAE-A17E-448E67FBE5B3', '1637905904.191289', '頭份竹南景點推薦．苗栗一日遊這樣也好玩~情侶、親子同遊一網打盡', '苗栗景點推薦去哪玩？頭份及竹南這一帶也蠻多有趣的景點，適合拍照，也可以帶小孩來放風，像是竹南有最受歡迎的牧場，也有今年最新開放的遊戲場，然後，如果是花季的時候來苗栗頭份，也可以賞花', '2021-08-26', , 0, '苗栗縣', '頭份鎮');
INSERT INTO `blog` (`id`, `uid`, `user_id`, `timestamp`, `title`, `content`, `date`, `photo`, `like_count`, `city`, `dist`) VALUES
(14, 'CECFA059-ADB3-4FEA-AE72-F180A3FC4CB5', 'A8DFAF5E-62B1-4BAE-A17E-448E67FBE5B3', '1637906145.0584269', '雲林一日遊 行程推薦~包含虎尾 古坑 斗六一日遊．親子,情侶約會去', '雲林景點推薦, 一日遊怎麼玩,有哪些是雲林的必玩景點呢,雲林最熱門的地區不外乎古坑,虎尾及斗六,光是這幾區,就可以排出很多條不同的雲林一日遊路線,有適合親子同遊,也有情侶約會景點,例如古坑的山中景點,不只有古坑,還有看夜景', '2020-11-26', , 0, '雲林縣', '虎尾鎮'),
(15, '6F21044F-2FB6-481A-AC1D-E50D9E32ECD1', 'A8DFAF5E-62B1-4BAE-A17E-448E67FBE5B3', '1637906293.2372432', '台北景點,手信坊創意和菓子文化館~超大菓子娃娃太可愛，還可以享用空中花園下午茶品牌與觀光工廠結合，轉變而成文化館的例子是愈來愈多囉！也讓我們除了買他們的商品之外，還多了一個可以遊玩的地方。手信坊創意和菓子文化', '台北景點,手信坊創意和菓子文化館~超大菓子娃娃太可愛，還可以享用空中花園下午茶品牌與觀光工廠結合，轉變而成文化館的例子是愈來愈多囉！也讓我們除了買他們的商品之外，還多了一個可以遊玩的地方。', '2021-11-11', , 0, '新北市', '汐止區');
INSERT INTO `blog` (`id`, `uid`, `user_id`, `timestamp`, `title`, `content`, `date`, `photo`, `like_count`, `city`, `dist`) VALUES
(16, '4330F18D-DEB2-4930-88B7-BA8D4450CF98', 'A8DFAF5E-62B1-4BAE-A17E-448E67FBE5B3', '1637906455.684304', '桃園客家文化館親子探索館', '全台唯一客家主題親子探索館提供全年齡化客語沉浸式互動空間。家家酒、角色扮演、繪本與桌遊、劇場表演、DIY等8大主題玩瘋，這裡也是賞桐花好去處，玩完親子館賞桐花趣！', '2021-02-26', , 0, '桃園市', '中壢區');
INSERT INTO `blog` (`id`, `uid`, `user_id`, `timestamp`, `title`, `content`, `date`, `photo`, `like_count`, `city`, `dist`) VALUES
(17, '544FD1FD-120B-453B-AA46-A35F557A74A6', 'A8DFAF5E-62B1-4BAE-A17E-448E67FBE5B3', '1637907019.568579', '桃園八德兒童玩具圖書館', '好美的森林玩具圖書館！豐富藏書、7大遊戲館有600組玩具，並設有5大類數位互動設施通通免費玩；館內也有玩具修復站、二手玩具交換，快帶孩子來玩具樂園玩中學！', '2021-06-26', , 0, '桃園市', '八德區');
